import axios from 'axios';
import React, { useEffect, useState, useRef } from 'react';
import VideosWrapper from "./VideosWrapper"

const History: React.FC = () => {
  const episode_number = useRef<number>(0);
  useEffect(()=>{
    axios.get(`/episode_number`)
      .then((res) => {
        episode_number.current = res.data.episode_number;
      });
  },[]);
  const videoList = [...Array(10)].map((x, i) =>
    <VideosWrapper />
  );

  return (
    <div className="h-screen flex flex-col overflow-auto justify-items-center align-center mx-auto">
      {videoList}
    </div>
  );
};

export default History;
